import bisect

class Solution:
    def lengthOfLIS(self, nums):
        # tails[i] 代表長度為 i+1 的遞增子序列的最小尾端元素
        tails = []
        for num in nums:
            idx = bisect.bisect_left(tails, num)
            if idx == len(tails):
                tails.append(num)
            else:
                tails[idx] = num
        return len(tails)
